import React from "react";
import { Text, View, StyleSheet, Dimensions } from "react-native";

const kart = () => {


    return (<View style={styles.kartContainer}>
        <Text>RestaurantCart
        </Text>
    </View>);
};


const genislik = Dimensions.get("window").width;

const styles = StyleSheet.create({
    kartContainercontainer: {
        width: genislik,//cihazın genişliği ile uyumlu hale getirildi.
        backgroundColor: '#a29bfe',

    },
});
export default kart;
